import React from 'react';
import styled from 'styled-components';
import Logo from '../../Images/Logo/SpinzerLogoGolgenSilver.png';

const FooterDiv=styled.div`
width: 100vw;
height: 50vh;
background-color: #000d1a;

`;

const ImageDiv=styled.div`
width: 300px;
height: 100%;
`;

const ContentDiv=styled.div`
align-items: center;
justify-content: center;
margin-top: 20px;
h1{
    padding-top: 20px;
    color: whitesmoke;
    
}
h3{
    color:whitesmoke;
    padding-top: 20px;
    font-size: 25px;
}
p{
    color: whitesmoke;
    padding-top: 10px;
    font-size: 20px;
}

`;

const Footer = () => {
    return (
       <FooterDiv>
           {/* <div class="container"> */}
  <div class="row">
    <div class="col"> 
      <ImageDiv>
           <img src={Logo} style={{height:'20vh',marginTop:'50px'}}/>
           </ImageDiv>
    </div>
    <div class="col">
    <ContentDiv>
        <h1>
            Spinzer
        </h1>
        <h3>
            Serving with Smile with Every Slice
        </h3>
        <p>
            we are here to serve better
        </p>
</ContentDiv>
    </div>
    <div class="col">
      Column
    </div>
  </div>
{/* </div> */}
        
         
       </FooterDiv>
    )
}

export default Footer
